    async function checkUpdate() {
        try {
            var { workPlace: main } = multiple;
            var semver = require('semver');
            var { data } = await axios.get("https://cherry-sever.glitch.me/update");
            var localVersion = JSON.parse(readFileSync(main + '/package.json')).version;
            if (data.some(item => semver.lt(localVersion, item.version))) {
                var i = data.find(item => semver.lt(localVersion, item.version));
                log("CHECK UPDATE", `Đã có bản cập nhật ${i.version}, bản cập nhật này có những thay đổi sau:`, 'warn');
                console.log(i.info)
                log("CHECK UPDATE", "Gõ: 'node update' vào cmd để tiến hành cập nhật.", "warn");
            }
        } catch (error) {
            return log("CHECK UPDATE", "Không thể kiểm tra cập nhật, vui lòng kiểm tra và thử lại.", "error");
        }
    }

